import React, {Component} from 'react';
import NavBar from './Components/Layout/NavBar';
import {BrowserRouter as Router, Route} from 'react-router-dom'; 


function App() {
  return (
    <Router>
      <NavBar />
      <Route path="/profile"></Route>
    </Router>
  );
}

export default App;
